create table income_statement (
	id INT,
	business_name VARCHAR(50),
	manager VARCHAR(50),
	date VARCHAR(9),
	product_sales INT,
	service_revenue INT,
	raw_material INT,
	labor INT,
	salaries_wages INT,
	rent_exps INT,
	supplies_exps INT,
	marketing_exps INT,
	utillities_exps INT,
	depreciation INT
);
